function drawLine(x1,y1,x2,y2)
{
  if (x1>x2)
  {
    var  x2_=x2;
    var  y2_=y2;
    x2=x1; y2=y1; x1=x2_; y1=y2_;
  }
  var dx = x2-x1, dy = Math.abs(y2-y1),
  x=x1, y=y1, y_inc=(y1>y2)?-1:1;
  if (dx>=dy)
  {
    var x_old=x, pr=dy<<1, pru=pr-(dx<<1), p=pr-dx;
    while ((dx--)>0)
    {
      x++;
      if (p>0)
      {
        newDiv(x_old,y,x-x_old,1);
        x_old=x; y+=y_inc; p+=pru;
      }
      else
        p+=pr;
    }
    newDiv(x_old,y,x2-x_old+1,1);
  }
  else
  {
    var pr=dx<<1, y_old=y, pru=pr-(dy<<1), p=pr-dy;
    if (y2<=y1)
    {
      while ((dy--)>0)
      {
        if (p>0)
        {
          newDiv(x++, y, 1, y_old-y+1);
           y_old=y; y+=y_inc; p+=pru;
        }
        else
        {
          y+=y_inc; p+=pr;
        }
      }
      newDiv(x2,y2,1,y_old-y2+1);
    }
    else
    {
      while ((dy--)>0)
      {
        y+=y_inc;
        if (p>0)
        {
          newDiv(x++,y_old,1,y-y_old);
          y_old=y; p += pru;
        }
        else
          p+=pr;
      }
      newDiv(x2,y_old,1,y2-y_old+1);
    }
  }
}//---------------------------------------------------------------
